        Senter (@cherylsenter) was warned that the deep, direct stare of the husky
        mix puppy she was adopting frightened people, but she felt an immediate connection.
        \u201cPeople fear what they don\u2019t understand,\u201d says Cheryl, a photojournalist
        based in New Hampshire. \u201cI got it right away \u2014 Bella was a visual
        being, just like myself.\u201d Cheryl calls her other dog, Rudy, a Chihuahua-schipperke
        mix, a \u201cgodsend\u201d for coming into her life during hard times. Rudy
        had a magical calming effect on Cheryl\u2019s parents, one of whom was suffering
        from Alzheimer\u2019s, and the other from dementia. \u201cWhen things started
        getting intense with my parents, my images started to reflect my dark emotions,\u201d
