        or look for naturally occurring moments around you that appear to be defying
        reality in some way.\n\nUse light to your advantage. For example, especially
        dramatic lighting or photographing at dawn or dusk can help add a dreamlike
        quality to your images.\n\nPay attention to your setting. Look for outdoor
        scenes that may resemble another planet, or transform your own home into an
        imaginary scene inspired by another place or time.\n\nPROJECT RULES: Please
