        week at Frieze Masters art fair in London, Helly Nahmad Gallery is breaking
        from the convention of a minimal, white-wall setting for its art. Instead,
        the gallery presents works by the French artist Jean Dubuffet, who sought
        inspiration in numerous visits to mental institutions in the 1940s, alongside
        a vivid set based on those experiences and the art that he found there. \u201cIt
        was equal parts surprising and refreshing because one rarely sees a booth
        at an art fair devote such space and resources to making the artist\u2019s
        inspiration legible,\u201d says Patricia Cronin (@patricia_cronin), who lives
        in New York City. \u201cAs an artist, I find these other artists\u2019 creative
        processes incredibly inspiring and this made me want to get back in the studio
