        bit of creepy. \u201cI\u2019m not into Goth in the classic way with lots of
        black eyeliner,\u201d says Christine. \u201cI\u2019m into poking fun at something
        actually scary. I like toying with that.\u201d Trained as a hair and makeup
        artist, Christine, who lives in Twin Peaks, California, taught herself to
        bake by watching online videos. She crafts everything from Mot\u00f6rhead
        \u201cWarpig\u201d cakes to waffle cones that look straight out of \u201cLittle
        Shop of Horrors,\u201d and then stages them \u2013 and herself \u2013 in late
        \u201850s motif. \u201cThat\u2019s the style of woman that I grew up thinking
        was perfect,\u201d says Christine. \u201cWhen people say, \u2018You were born
        in the wrong era,\u2019 I\u2019m like, \u2018No, no, no. I like where we are
        now.\u2019 But I do like the aesthetic of the time.\u201d Baker, photographer,
        seamstress, set designer \u2013 Christine does it all. \u201cThere\u2019s
        no one else involved. It\u2019s literally just me,\u201d she says. \u201cPeople
        go to bars and have friends and have children and families. This is really
        what I do. It is a sacrifice in some ways, to do this all the time, but it\u2019s
